@import '../logo/logo.scss';
@import './registration/registration.scss';
@import './menu/menu.scss';

@media screen and (max-width: 1152px){
    .container{
        margin: 0 10px 0 10px;
    }
}

@media screen and (min-width: 1153px){
    .container{
        margin: 0 140px 0 140px;
    }
}
.page-header{
    background: white;
    display: flex;
    position: relative;
    align-items: center;
    height: 70px;
    width: 100%;
    z-index: 3;
}
.header__background{
    position: absolute;
    z-index: -1;
    background-color: white;
    width: 100%;
    height: 100%;
}
.header{
    position: relative;
    box-shadow: 0px 10px 20px 0px rgba(31, 32, 65, 0.05);
}
.menu{
    display: flex;
}
.header__push{
    display: flex;
    align-items: center;
    margin-left: auto;
    padding-left: 50px;
}
.header__burger{
    display: none;
}
@media screen and (max-width: 970px){
    .header__burger{
       display: block; 
       position: absolute;
       width: 30px;
       height: 20px;
       right: 20px;
    }
    .logo{
        z-index: -1;
    }
    .header__burger:before, .header__burger:after{
        content: '';
        background:rgb(172, 172, 172);
        position: absolute;
        width: 100%;
        height: 3px;
        left: 0;
        transition: all 0.3s ease 0s;
    }
    .header__burger span{
        position: absolute;
        background:rgb(172, 172, 172);
        left: 0;
        width: 100%;
        height: 3px;
        top: 8px;
        transition: all 0.3s ease 0s;
    }
    .header__burger:before{
        top:-2.5px;
        
    }
    .header__burger:after{
        bottom: -1px;
    }
    .header__burger.active:before{
        transform: rotate(45deg);
        top:8px;
    }
    .header__burger.active:after{
        transform: rotate(-45deg);
        bottom: 9px;
    }
    .header__burger.active span{
        transform: scale(0);
    }
    .header__push{
        box-shadow: -5px 5px 10px 0px rgba(31, 32, 65, 0.15);
        background-color: white;
        top: -350px;
        margin-left: auto;
        display: flex;
        flex-direction: column;
        position: absolute;
        right: 0;
        width: auto;
        height: auto;
        padding: 10px;
        z-index: -2;
        transition: all 0.3s ease 0s;
    }
    .header__push.active{
        top:70px;
        
    }
    .search-form{
        z-index: 0;
    }
    .page-header .button-filled{
        margin-top: 10px;
        margin-left: -19px;
        border-radius: 22px;
    }
    .page-header .button-unfilled{
        margin-left: -17px;
        border-radius: 22px;
    }
    .reg{
        display: flex;
        flex-direction: column;
        align-items: center;
    }
    .menu{
        margin-left: auto;
        display: block;
    }
}

