.dropdown_count{
    -webkit-touch-callout: none; /* iOS Safari */
    -webkit-user-select: none;   /* Chrome/Safari/Opera */
    -khtml-user-select: none;    /* Konqueror */
    -moz-user-select: none;      /* Firefox */
    -ms-user-select: none;       /* Internet Explorer/Edge */
    user-select: none; 
    z-index: 8;
    position: relative;
    background: white;
    .dropdown_count__button{
        display: flex;
        height: 44px;
        justify-content: space-between;
        border: 1px solid rgba(31, 32, 65, 0.25);
        border-radius: 4px;
    }
    .dropdown_count__button.active{
        border-radius: 4px 4px 0 0;
        border: 1px solid rgba(31, 32, 65, 0.5);
    }
    .dropdown_count__arrow{
        width: 44px;
        align-items: center;
        justify-content: center;
        display: flex;
        padding-top: 2px;
        margin-left: -44px;
        z-index: 0;
        color: rgba(31, 32, 65, 0.5);
    }
    .dropdown_count__input{
        display: flex;
        align-items: center;
        background: rgba(0, 0, 0, 0);
        z-index: 1;
        font-family: 'Montserrat';
        font-size: 14px;
        padding-left: 15px;
        width: 100%;
        border: none;
        color: rgba(31, 32, 65, 0.75);
        cursor: pointer;
    }
}
.dropdown_count__list.active{
    margin-top: -1px;
    opacity: 1;
    transition: opacity .3s ease 0s, margin-top .1s ease 0s;
}

.dropdown_count__list{
    margin-top: -6px;
    opacity: 0;
    transition: all .3s ease 0s;
    position: relative;
    z-index: 7;
    display: flex;
    flex-direction: column;
    background: white;
    border: 1px solid rgba(31, 32, 65, 0.5);
    border-radius: 0 0 4px 4px;
    box-shadow: 0px 10px 20px rgba(31, 32, 65, 0.05);
    -webkit-touch-callout: none; /* iOS Safari */
    -webkit-user-select: none;   /* Chrome/Safari/Opera */
    -khtml-user-select: none;    /* Konqueror */
    -moz-user-select: none;      /* Firefox */
    -ms-user-select: none;       /* Internet Explorer/Edge */
    user-select: none; 
    .dropdown_count__list.active{
        margin-top: -1px;
        
    }
    .list_content{
        margin: 13px 7px 13px 15px;
        display: none;
    }
    .list_content.active{
        opacity: 1;
        display: block;
    }
    .dropdown_counters{
        width: 100%;
        font-family: 'Montserrat';
        font-size: 12px;
        font-weight: bold;
        .dropdown_counter{
            margin-bottom: 7px;
            display: flex;
            justify-content: space-between;
            align-items: center;
            width: 100%;
            .counter{
                display: flex;
                align-items: center;
                div{
                    margin-left: 5px;
                }
                .counter__sign{
                    position: relative;
                    width: 30px;
                    height: 30px;
                    border: 1px solid rgba(31, 32, 65, 0.25);
                    border-radius: 22px;
                    box-sizing: border-box;
                    display: flex;
                    justify-content: center;
                    font-weight: normal;
                    font-size: 18px;
                    color: rgba(31, 32, 65, 0.5);
                    cursor: pointer;
                }
                .counter__num{
                    width: 20px;
                    display: flex;
                    justify-content: center;
                }
                .sign_minus.disabled{
                    opacity: 0.38;
                }
                .sign_plus{
                    padding-top: 1px;
                }
            }
        }
    }
    .dropdown_buttons{
        margin-top: 19px;
        display: flex;
        justify-content: space-between;
        .dropdown_button{
            border: none;
            background: white;
            font-family: 'Montserrat';
            font-weight: bold;
            font-size: 12px;
            color: #BC9CFF;
            padding: 0;
            cursor: pointer;
            &:focus{
                outline: none;
            }
            &:hover{
                color: rgba(31, 32, 65, 0.5);
            }
        }
    }
}
